import React, {Component} from 'react'
import Collection from './Collection'

export default class Entradas extends Collection {


    render() {

        const {entradas} = this.state;

        return(
            <div className="p-2">

                {entradas && entradas != undefined ? entradas.map((post, key) => 
                    <div key={key} className="col-12 p-1 bg-light rounded shadow mt-2 d-flex align-items-center">
                        {/* <p className="col-12 text-right">{Math.abs(new Date() - post.data.time.getTime)}</p> */}
                        <p className="pt-1">{post.data.user}: {post.data.post}</p>
                    </div>
                ) : null }

            </div>
        )
    }
}
